import React from 'react';

function Dashboard() {
  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>Hoşgeldiniz!</h1>
      <p>Bu sayfa üzerinde ticketlar ve raporlar yer alacak.</p>
    </div>
  );
}

export default Dashboard;
